// src/components/SetupReview.tsx
import React from 'react';
import type { ICCSetup } from '../types/ICC';

interface SetupReviewProps {
  entries: ICCSetup[];
  dashboard: string;
}

const SetupReview: React.FC<SetupReviewProps> = ({ entries, dashboard }) => {
  return (
    <div style={{ marginBottom: '2rem' }}>
      <h4>üìù Review ‚Äì {dashboard}</h4>
      {entries.map((setup, index) => (
        <div
          key={index}
          style={{
            marginBottom: '1rem',
            padding: '0.5rem',
            borderBottom: '1px solid #eee',
          }}
        >
          <strong>{setup.symbol}</strong> ({setup.timeframe})  
          <br />
          Tags: {setup.iccTags.join(', ')}  
          <br />
          Outcome: {setup.outcome} | Bot: {setup.bot}
        </div>
      ))}
    </div>
  );
};

export default SetupReview;
